import React from 'react';
import styled from 'styled-components';

const ContactSection = styled.section`
  padding: 4em;
  background: #fff;
  color: #333;
  text-align: center;
`;

export const Contact = () => {
  return (
    <ContactSection>
      <h2>Contact Me</h2>
      <p>Email: tanishqjain010@gmail.com</p>
    </ContactSection>
  );
};
